import {FormChild} from "../childcomponents/FormChild";

export const LoginComponent = () => {
    const connection = (email,password) => {
        console.log(email,password)
    }
    const loginParameters = {
        title: "Connexion",
        subtitle: "Accédez à l'application",
        email:{
            label:"Adresse email",
            placeholder:"abc@gmail.com",
            type:"email",
        },
        password:{
            label:"Mot de passe",
            placeholder:"Entrez votre mot de passe",
            type:"password",
        },
        button:{
            value:"Se connecter"
        },
        event: connection,
        signupUrl:"/signup"
    }

    return (
        <FormChild loginParameters={loginParameters}/>
    )
}
